import { hasUncaughtExceptionCaptureCallback } from "process";
import { ItineraryCell } from "../Components/Itinerary/ItineraryCell";
import { mockItineraries } from "../Models/MockItineraries"

// pretend that mock itineraries and mock locations are the store
export const getItineraryById = (id: number) => {
    const result = mockItineraries.filter((itinerary) => (
        id = itinerary.id
    ));

    if(result.length === 0) {
        throw new Error(`Could not fetch itinerary with id ${id}`);
    }

    return result[0];
}
